INSERT INTO `ams_approver_person` (`id`, `user_id`, `temp_approver_id`, `app_id`, `position`, `forward`, `remarks`, `read`, `status`, `case_status`, `email_log_time`, `date_to_email`, `group_id`, `created_at`, `updated_at`) VALUES
(1, 117, 0, 1, 0, 1, 'Dear SG,\r\nLewis met with our team to speak on this matter earlier.\r\nThe latest project budget is lower than previous budgets, we should support the project.\r\nSeeking your approval, pls. \r\n\r\nCharis', 1, 1, 0, 48, '2016-01-13 11:59:46', 0, '2016-01-13 11:59:47', '2016-01-13 18:24:51'),
(2, 21, 0, 1, 1, 1, '', 0, 0, 0, 48, '2016-01-15 11:59:47', 0, '2016-01-13 11:59:47', '2016-01-13 18:24:51'),
(3, 118, 0, 2, 0, 1, 'Please remember to prepare a PO for this.', 1, 1, 1, 48, '2016-01-13 13:48:03', 0, '2016-01-13 13:48:04', '2016-01-13 13:52:45'),
(4, 117, 0, 3, 0, 1, 'Dear SG,\r\n\r\nPlease view SRC\'s representative in Nepal, Mdm Kalpana Chhetry. \r\n\r\nThe application of VAT cert will make savings of approx 1.1 million rp (~S$15,000) of service tax, but the funds remitted from SRC will occur income tax of 13%, resulting to a lost of 9.9 million rp (~S$133,000).\r\n\r\nSRC should advise Praramva not to apply for VAT cert. \r\n\r\nFor your advice, pls. ', 1, 1, 0, 48, '2016-01-13 18:22:42', 0, '2016-01-13 18:22:43', '2016-01-13 18:41:08'),
(5, 21, 0, 3, 1, 1, 'Given the complications that will arise if we apply for VAT refund which may result in even greater expenditure, I approve the proposal for Praramva not to apply for VAT refund .\r\n\r\nRegards\r\nBen ', 1, 1, 1, 48, '2016-01-15 18:22:43', 0, '2016-01-13 18:22:43', '2016-01-14 15:43:49'),
(6, 57, 0, 4, 0, 1, 'Endorsed for this candidate to join CS. ', 1, 1, 0, 48, '2016-01-13 19:36:13', 0, '2016-01-13 19:36:14', '2016-01-14 09:12:36'),
(7, 118, 0, 4, 1, 1, 'Hi Sherlee\r\n\r\nHow maximise are the existing staff and if there is an increase in activities, what is the number? Not percentage please.', 1, 2, 2, 48, '2016-01-15 19:36:14', 0, '2016-01-13 19:36:14', '2016-01-14 13:03:04'),
(8, 103, 0, 5, 0, 1, '', 0, 0, 0, 48, '2016-01-14 11:54:03', 0, '2016-01-14 11:54:04', '2016-01-14 11:54:04'),
