(19, 117, 0, 13, 0, 1, 'Dear SG,\r\n\r\nSeeking approval for the usage of Myanmar Flood funds and Nepal Relief funds for the purchase of stickers.\r\n\r\nThanks. ', 1, 1, 0, 48, '2016-01-14 15:18:21', 0, '2016-01-14 15:18:22', '2016-01-14 16:17:16'),
(20, 21, 0, 13, 1, 1, 'Dear Stephanie,\r\n\r\nI will approve this request. \r\n\r\nPlease note that in future, this request since it has financial implications, should include Hd/Finance in the cc.  It should also include Hd/CCM in the cc.  \r\n\r\nWarm regards\r\nBen ', 1, 1, 1, 48, '2016-01-16 15:18:22', 0, '2016-01-14 15:18:22', '2016-01-18 09:01:50'),
(21, 65, 0, 14, 0, 1, 'Attachment with hard copy of Training request form and seminar details was attached but is missing when sent to me through this system.', 1, 1, 1, 48, '2016-01-14 15:42:48', 0, '2016-01-14 15:42:49', '2016-01-18 11:34:42'),
(22, 117, 0, 15, 0, 1, 'Dear SG,\r\n\r\nPlease view request of change of projects from The Secretary of Synod of the Diocese of Singapore, worth S$406,200. The latest budget is less than the approved initial budget. \r\n\r\nThe funding disbursement schedule is attached above. \r\n\r\nFor your approval, pls. ', 1, 1, 0, 48, '2016-01-14 16:23:39', 0, '2016-01-14 16:23:40', '2016-01-14 16:58:42'),
(23, 21, 0, 15, 1, 1, 'Dear IS\r\nI note that the schools are within the scope of what was originally approved.  What has changed is the number of schools to be rebuilt has been reduced. \r\nThe revised proposal is approved together with the revised disbursement schedule. \r\n\r\nWarm regards\r\nBen ', 1, 1, 1, 48, '2016-01-16 16:23:40', 0, '2016-01-14 16:23:40', '2016-01-14 17:04:51'),
(24, 21, 0, 16, 0, 1, 'Dear Tilyn, \r\n\r\nI understand there are no cost implications for SRC.  The two proposed YEP are approved. \r\n\r\nWarm regards\r\nBen ', 1, 1, 1, 48, '2016-01-14 17:28:11', 0, '2016-01-14 17:28:12', '2016-01-18 09:04:33'),
(25, 21, 0, 17, 0, 1, 'Please resubmit.  The submission should come to me through Sahari and Steven, so that I can see their comments.  Finance and RCY staff can be copied on the submission. ', 1, 2, 2, 48, '2016-01-14 17:36:26', 0, '2016-01-14 17:36:27', '2016-01-14 20:54:13'),
