(45, 21, 0, 30, 1, 1, 'Dear Vincent;\r\nApproval is given for the RCY World Red Cross Day cum Enrolment and EUA Ceremony 2016 to proceed and the RCY budget to be utilised.  Please note that the normal procedures for the various expenditures must still be adhered to.  \r\n\r\nA few points since this is still a new system:\r\n\r\n- The main submission should be directly in the system and not attached as a paper.  The concept note can be attached document.  The main submission should include all the main points, including the date of the proposed event; and the decision that is required.   I only found the date buried in the concept note. \r\n-  Everyone who does a submission must think carefully who else should know about this.  This submission - Hd/Finance should be on the approval list. he can then add that the budget is truly available.  Minimum he should be on the cc list.  If it includes other national societies, Hd/IS should be included in cc.  These are just examples.  \r\n\r\nThese are just some learning points, not criticism.  Please share these comments with your colleagues.  \r\n\r\nWarm regards\r\nBen', 1, 1, 1, 24, '2016-01-16 17:22:59', 0, '2016-01-15 17:22:59', '2016-01-18 09:22:10'),
