(185, 65, 0, 108, 0, 1, '<p>The present uniform was recommended and approved&nbsp;about 5 years ago. The design and material was based on comfort, durability, cost and ease of care. Through the years, the vendor has changed the material of both the tees and pants and it does not meet needs. Staff has fedback that the pants material is very stiff and rough which makes it difficult for them to&nbsp; bend and squat (something they have to do in the course of their work) and the tees are very warm. Existing vendor is unable to accede to our request to change the material.</p>', 1, 1, 0, 48, '2016-02-01 17:20:09', 0, '2016-02-01 17:20:10', '2016-02-02 12:21:15'),
(186, 21, 0, 108, 1, 1, '<p>Please resubmit. &nbsp;This is an important submission and I want it in the system, not as an attachment.&nbsp;</p><p>Learning points:</p><p>It has financial implications. &nbsp;So Head/Finance and DSG/A should be copied.&nbsp;</p>', 1, 2, 2, 48, '2016-02-03 17:20:10', 0, '2016-02-01 17:20:10', '2016-02-04 08:13:51'),
(187, 45, 0, 109, 0, 1, '<p>Tampines Central Community Plaza is strategically located beside Tampines MRT Station. We are granted the&nbsp;use of the space free of charge, however it is not a covered facility thus we need to deploy tentage.</p><p>Compare the previous event locations at Tampines West and Tampines Central, and with the presence of Minister Heng Swee Keat,&nbsp;this location will provide better visibility and attract more human traffic.</p><p>The location set up cost of $11,450 include tentage, stage &amp; backdrop, &nbsp;40 tables, 300 chairs, Gen-Set &amp;&nbsp;Audio-Visual &nbsp;system</p><p>&nbsp;</p>', 1, 1, 0, 48, '2016-02-01 18:28:33', 0, '2016-02-01 18:28:34', '2016-02-01 19:49:35'),
(188, 21, 0, 109, 1, 1, '<p>Approved.&nbsp;</p><p>&nbsp;</p><p>Learning point:</p><p>This submission has budget implications. &nbsp;Hence Head/Finance and DSG/A should be copied. &nbsp;I note there is a publicity element, so perhaps Head/CCM should be copied. &nbsp;The author of the submission must always think carefully who should be on the approval list, and who should be on the cc list. &nbsp;Its very much as important as the submission itself.&nbsp;</p>', 1, 1, 1, 48, '2016-02-03 18:28:34', 0, '2016-02-01 18:28:34', '2016-02-04 08:11:46'),
(189, 75, 0, 110, 0, 1, '<p>Approve. Within the budget allocated for CLARE volunteers training and RSVP is the provider that fulfil the requirement and lowest quote.</p>', 1, 1, 0, 48, '2016-02-01 18:55:45', 0, '2016-02-01 18:55:46', '2016-02-01 18:58:33'),
