(215, 21, 0, 125, 2, 1, '<p>Dear Zakirah,</p><p>Approved. &nbsp;Pls proceed.&nbsp;</p><p>&nbsp;</p><p>Dear Serene &amp; Sudirman - the idea of the AMS is to have the submission in the system. &nbsp;Hence, for example, this submission; all the information in the attached document should be directly in the submission in the AMS. &nbsp;No need to attach the document. &nbsp;Attached documents in an AMS submission is for draft documents to be cleared, or scanned documents, e.g. quotations by a company, a letter received by SRC which is rlevant to the submission, etc. &nbsp;Hope this clarifies.&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p>', 1, 1, 1, 24, '2016-02-05 16:17:53', 0, '2016-02-03 16:17:53', '2016-02-04 08:07:58');
