(840, 57, 0, 421, 1, 1, '<p>Hi Faiszah,</p><p>This is a new estab&nbsp;for SRCA in 2016, and Jackie is a temp worker not sitting in this estab but to cover work for Nadia when she was on maternity and later on you extended his stint.</p><p>HR will endorse at this point as pointed out by Sr Management in the previous emails (DSG/O and Sec Gen) that this being an approved new estab.</p><p>But HR, being extra prudent for 2016, we urge you to consider the following after the ISO has been obtained:</p><p>-the volume of work that your current&nbsp;coordinators do? And how much more can we maximize their scope of work, as per desired by Chairman. For example you have eight&nbsp;coordinators (1exec, 4SAA, 3AA)&nbsp;what the number of&nbsp;students they each deal with, and how many group clients do they deal with per week?&nbsp;</p><p>- How much has SRCA automated? Also recently you have a new machine which helps you with printing/scanning of certs, how can this automation help to reduce your reliance of manpower expansion?&nbsp;</p><p>Let&#39;s look at this together, to see if there is a need to streamline, or if there are areas for expansion and hence the need for more manpower etc.&nbsp;</p>', 1, 1, 0, 12, '2016-03-30 23:51:09', 0, '2016-03-30 11:51:09', '2016-03-31 10:01:53'),
