(1001, 45, 0, 481, 0, 1, '<p>Approved.</p><p>MOE has been strongly encouraging UG to support this initiative. This initiative aims to provide a platform for youth to acquire life skill through this internship programme. Furthermore it hopes that through the internship programme, youth will continue to be involve with the UG either through volunteering or as a career. We have been supporting this programme for the past months and our past interns have continue to volunteer with us.</p><p>For the past the funding is provided by NYC through MOE. This year, the funding is directly from MOE as they believe it is a good programme with less requirement attached.</p><p>&nbsp;</p><p>As UG, we shoule support this programme. but most importantly, we believe that it is good intiatiave and provide the additional HR support for RCY especially we are increasingly expanding&nbsp;our activities in term of scope and depth.</p><p>&nbsp;</p><p>&nbsp;</p>', 1, 1, 0, 48, '2016-04-07 19:58:24', 0, '2016-04-07 19:58:25', '2016-04-08 09:24:51'),
(1002, 57, 0, 481, 1, 1, '<p>Please resend with information regarding which cost centre to charge to, and set Steven as final approver, and to CC Isaac. Thanks.</p>', 1, 2, 2, 48, '2016-04-09 19:58:25', 0, '2016-04-07 19:58:25', '2016-04-08 13:32:24'),
