(1072, 65, 0, 515, 0, 1, '<p>This idea was mooted in order to meet the needs of the residents as well as to maintain continuity of care. The search for Staff Nurse&#39;s (SN) to fill estab needs have been a long process and hiring locum&#39;s (agency nurses) will alleviate the manpower shortage whenever one of the SN&#39;s go on leave or on long MC. Technically there should be at least&nbsp;3 SN&#39;s in the estab pool at all times or 1 for a short span of 3 to 4&nbsp;days full shift as the job is taxing both physically and mentally. As stated in the proposal SN Cheri will be on leave for 2 weeks to attend to family matters therefore the remaining SN has to do 8-4 full day duty for the duration of Cherie&#39;s leave. The estab budget is for 4 SN&#39;s and presently RCHD has only 3&nbsp;after a long recruitment process. Once the 4th SN is hired, the need for locum/agency nurses should decrease. The budget for the locum/agency nurse has not been budgetted for.</p>', 1, 1, 0, 48, '2016-04-15 17:37:49', 0, '2016-04-15 17:37:50', '2016-04-18 09:49:42'),
