(1270, 65, 0, 577, 0, 1, '<p>IMH is offering this consultancy and training to VWO&#39;s. Please refer to email below for added information.</p><p>&nbsp;</p><p>IMH CLINICAL CONSULTANCY PROJECT (3RD RUN) - Red Cross Home for the Disabled</p><p>&nbsp;</p><p><strong>Yeong Sian TAN (MSF)</strong></p><p>Apr 1</p><p>to me, Sudirman, Jun, Christina, Rebecca</p><p>Dear Ms Serene Chia,</p><p>&nbsp;</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; MSF has been partnering the Institute of Mental Health (IMH) since 2012 to provide clinical consultancy services to our Adult Disability Homes (ADH) and Day Activity Centres (DAC). The objective of this project is to enhance staff capability in managing clients with challenging behaviours.</p><p>&nbsp;</p><p>2&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; I am pleased to inform you that Red Cross Home for the Disabled (ADH and DAC) has been selected to be part of this 3rd run, from April 2016 to March 2017. Subsequently, there will be a year of continual consultancy from April 2017 to March 2018 but at a lower intensity of participation.</p><p>&nbsp;</p><p>3&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; A multi-disciplinary team from IMH, consisting of the psychiatrist, psychologists, occupational therapists, social workers and nurses, will train direct care staff who have to work with challenging clients. The scope of training consists of workshops, case conferences, onsite supervisions for the staff, as well as clinical assessment for clients selected for the project. In the course of this project, there are also opportunities for both the IMH team and the VWO&rsquo;s staff to share their experiences and techniques to manage challenging clients.</p><p>&nbsp;</p><p>4&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; This project is MSF-funded and VWOs are not required to pay to participate in the project.</p><p>&nbsp;</p><p>5&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; What we do require from VWOs is the commitment to participate in the project for the period of 1+1 years as mentioned above, as well as allow selected direct care staff to participate in the training and supervision sessions.</p><p>&nbsp;</p><p>6&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; We will be arranging a pre-project meeting with you shortly to discuss more details. Please contact me should you have any queries.</p><p>&nbsp;</p><p>Rgds,</p><p>&nbsp;</p><p>&nbsp;</p><p><strong>Tan Yeong Sian, Manager, Disability Services Section (DSS), </strong></p><p><strong>Service Development and Management Division, Ministry of Social and Family Development </strong></p><p>510 Thomson Road SLF Building #16-02 Singapore 298135 | DID: (65) 6354 7404 Fax: 6259 9450 Website: www.msf.gov.sg | Facebook: www.facebook.com/MSFSingapore</p><p><strong>Please consider the environment before printing this mail note</strong></p><p><strong>&nbsp;</strong></p><p><strong>WARNING </strong>: This email may contain privileged and confidential information. If you receive this email by mistake, you should immediately notify the sender and delete the email. Unauthorised communication and disclosure of any information in the email is an offence under the Official Secrets Act (Cap 213).</p>', 1, 1, 0, 48, '2016-04-28 09:51:15', 0, '2016-04-28 09:51:15', '2016-04-28 10:11:52'),
