(1361, 57, 0, 608, 1, 1, '<p>Hi Khairul,</p><p>As discussed, we will post this job either as SWA. We will not say it&#39;s exec position upfront, but will state the criteria in the summary:</p><ul><li>If this person has at least 0-3 years experience and Dip Holder in SW, he/she will be hired as SWA, level 4.</li><li>If this person has a degree, is a fresh grad and dip in SW, then we consider for Exec level.</li><li>If this person has at least a degree,&nbsp;and some years of working experience, and is pursuing his studies in SW, then we consider for Exec level.</li><li>If this person has only a dip in Social work, but have over 5 years of working experience, we can consider he/she to be an exec.&nbsp;</li></ul><p>Of course, the salary calculated will depend on the experience, knowledge and ability.</p><p>Thanks.</p>', 1, 1, 0, 48, '2016-05-05 12:54:08', 0, '2016-05-03 12:54:08', '2016-05-09 11:15:53'),
