(1375, 117, 0, 612, 1, 1, '<p>Dear SG,</p><p>Please see the above approval on the budget of&nbsp;2 teams to Philippines OHP.</p><p>According to the budget breakdown by HuiChun/RCY, the actual trip budget for the 2 teams, including air tickets, insurance, transport, accommodation and food etc for 37 pax (36 participants and 1 staff) totals up to 38,990&nbsp;SGD.</p><p>The direct cost of the visits, including the refurbishment of toilets, evacuation drills, hygiene kits, community outreace activities etc for 4 schools totals up to 40,000 SGD.</p><p>The costs incurred from IS would initially be <strong>78,990 SGD</strong>, supported by the Haiyan Relief Fund (301020). The participants are required to self fund, reimbursing a total amount of 10,800 SGD, and NYC&nbsp;support for the project would be up to 36,000 SGD (depending on NYC&nbsp;approval amount). The co-payment by participants&nbsp;and NYC grant will be reimbursed to the Haiyan Relief Fund.</p><p>The total cost of the OHP will eventually be approx 50,000 SGD.&nbsp;</p><p>For your approval, pls.&nbsp;</p><p>&nbsp;</p>', 1, 1, 0, 48, '2016-05-05 18:04:45', 0, '2016-05-03 18:04:45', '2016-05-09 16:01:57'),
