(1692, 78, 0, 758, 0, 1, '<p>I strongly disagree with the proposed salary.</p><p>Christabel, although not a degree holder is not a freshie. I would like to propose a starting pay of <strong>$2724.00</strong> based on work experience increment of $274.66 and potential increment at 80% for $150 ($2300 + $274 +$150).</p><p>My justifications are:</p><p>1) She has a diploma in teaching (TESOL) which is internationally recognised and is relevant to SRCA.</p><p>2) She has experience in training and event management (as indicated in her resume). I even verified this with the previous company director. &nbsp;</p><p>3) She has proven to be an asset for the last 6 months. All of us in the department agreed that it would be impossible for SRCA to attain the ISO 29990:2010 if not for her work. Even the consultant has put in his recommendation for her work. She single-handedly reviewed, organised and re-drafted all out SOPs to meet the ISO standards. She even reviewed the OFA training and trainer manuals to meet the MOM&#39;s technical notes.</p><p>4) She was the minute taker for the PFA TOT training. And the master trainer, Ms Pat from DRC also indicated that Christabel has all the aptitude and qualities to be a good PFA trainer.&nbsp;</p><p>5) She is already developing and conducting the RAID CROSS with Ambrose for the International Volunteers Day and has impressed Dir Svs, Sahari. He has approached her to be a potential YABC trainer.</p><p>All the above proves that Christabel is a staff worth keeping and developing. I agreed to the intial salary scale of $2300 as she was not tested although she has the relevant experience.&nbsp;</p>', 1, 1, 0, 12, '2016-05-20 18:25:38', 0, '2016-05-20 18:25:39', '2016-05-20 18:53:14'),
(1693, 57, 0, 758, 1, 1, '<p>Hi Ayden,</p><p>Please re-submit. There&#39;s an error in salary calculation. And please CC July and Mindy.</p>', 1, 2, 2, 12, '2016-05-21 06:25:39', 0, '2016-05-20 18:25:39', '2016-05-23 09:36:58'),
