(1710, 78, 0, 765, 0, 1, '<p>I disagree with HR proposed salary computation for the following factors;</p><p>&nbsp;</p><p><em>Refer to Christabel past working experiences, she has none relevant related working experiences for the current role and her pay scale grade is way off the entry requirment for executive. </em></p><p>- The new executive position is based on training, course development and event management for the Humanitarian Education initiatives under SRCA. This includes the Youth Leadership Camp and the Public Lecture Series. Based on that scope, Christabel has the necessary working experience for she did teaching before. One of the previous job is also to organise Youth Leadership training and Camp all the way to Nepal. She has even organised Youth Seminar for thousands of youths from China and other Southeast Asia region. Please refer to the JD and her resume for reference.</p><p><em>However, by strongly recommendation by Head of SRCA and approval from Sec Gen Mr Benjamin William. Do refer to AMS Case #SRCA/000719/2016</em></p><p>The previous evaluation form cannot be used here. That evaluation form was used solely for the ISO 29990:2010 work and nothing else. Thus all the ratings was based on that. To use the same evaluation form here is very misleading and unfair.</p><p>As her reporting officer, I believe it would be more justified for me to evaluate her potential and not HR.&nbsp;</p><p>Based on the above reasons, I strongly reject the proposed starting pay as I believe we should be fair to her who has worked hard to prove her worth for the last 6 months. I would like to maintain her starting pay to be the least $2700 based on all her relevant working experience (as deemed fit by her hiring supervisor) and 80% (the least) potential increment.</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p>', 1, 1, 0, 12, '2016-05-23 17:03:57', 0, '2016-05-23 17:03:58', '2016-05-23 18:19:55'),
(1711, 57, 0, 765, 1, 1, '<p>Do not agree with SRCA&#39;s recommendations to pay Chritabel $2,700. HR strongly recommends to only provide $2,450/- as her salary.</p><p>1. She only have a certificate, and cannot verify that it is a diploma, as the website in Singapore indicates that what she obtain is only a cert.</p><p>2. Even if it is an actual diploma, recommended starting pay is $2,100 for diploma holders. And we have also considered her relevant working experience of 3 years, 2013 to 2016, and have given increment as per an executive rate, and not an AA rate, indicated in our salary calculation.&nbsp;</p><p>Thanks.&nbsp;</p>', 1, 1, 0, 12, '2016-05-24 05:03:58', 0, '2016-05-23 17:03:58', '2016-05-23 18:28:55'),
(1712, 118, 0, 765, 2, 1, '<p>Hi Sherlee,</p><p>If you have different views, then why approve unless it can be proven otherwise. I have&nbsp;to approve this casue the system do not have pending and&nbsp;otherwise SG will not have sight on this</p>', 1, 1, 0, 12, '2016-05-24 17:03:58', 0, '2016-05-23 17:03:58', '2016-05-23 22:08:10'),
(1713, 21, 0, 765, 3, 1, '<p>Dear All</p><p>From the information I have, and at the current Executive Scale (Grade 5), S$2450 appears to be a reasonable salary offer. &nbsp;I will stick with the salary offer of S$2450 for now. &nbsp;Let&#39;s see how she progresses.&nbsp;</p><p>In any case we are in the process of finalising a salary revision for all staff, whiich should see her salary increase again in July. &nbsp;&nbsp;&nbsp;&nbsp;</p><p>Ben &nbsp;</p>', 1, 1, 1, 12, '2016-05-25 05:03:58', 0, '2016-05-23 17:03:58', '2016-05-23 23:04:49'),
