(2197, 74, 0, 958, 0, 1, '<ul><li>Approved request to re-initiate PR/PO for purchase of service - Laundry service</li><li>Noted and confirm budget provision for required.&nbsp;</li><li>Noted proposed arrangement to include this line item in every stays/exchange programme.&nbsp;</li><li>Confirm approved budget; exclusion of line item.&nbsp;</li></ul><p>Next step: Proceed with required documentation to account for service purchased.&nbsp;</p>', 1, 1, 1, 48, '2016-06-18 23:10:23', 0, '2016-06-18 23:10:24', '2016-06-20 10:51:48'),
(2201, 74, 0, 959, 0, 1, '<ul><li>Endorsed request for approval for OHP (Padang, West Sumatra, Indonesia) - 20 to 30 July 2016.</li><li>Noted a team of 25 volunteers and 1 staff member participating in the mentioned project.&nbsp;</li><li>Noted proposed budget with Total Expenditure for Actual Trip and Direct Project Cost: SGD&nbsp;20,140&nbsp;and SGD&nbsp;6,000&nbsp;respectively.</li><li>Noted funding structure as indicated above, notably&nbsp;Padang Earthquake Relief Fund (301012)<ul><li>Cost recovery expected through fundraising efforts except Staff&#39;s per diem.&nbsp;</li><li>Cost recovery expected through co-payment from 25 participants as well.</li><li>Budget breakdown sighted in attachment.&nbsp;</li></ul></li></ul>', 1, 1, 0, 48, '2016-06-19 00:38:45', 0, '2016-06-19 00:38:46', '2016-06-20 10:45:14'),
