(2230, 74, 0, 971, 0, 1, '<p>Endorsed (1) Event Concept for Members&#39; Conversation (MC) for programme flow and activity outline but require a revision in thematic focus.</p><p>a) Beyond the networking exercise, MC is part of the Stakeholder Management plan put forth in Q4 2015.&nbsp;</p><p>b) Findings from the MC will form key inputs for MVD&#39;s strategic planning for Year 2016.&nbsp;</p><p>c) Incorporation of thematic focus should bear in mind the IBC coalition on how we could better support affiliates to contribute to the Movement as active volunteer and Corporate partner (CSR). The level of satisfaction in programme (ie. current volunteering journey should take a back-seat). It could form the basis for the&nbsp;recommendation as a gap where mitigation/recommendation could be proposed. This should not be a feedback session only.&nbsp;</p><p>&nbsp;</p><p>Endorsed Budget breakdown. Please submit a hardcopy (using the approved template) to obtain signatory from HOD and Reporting Officer (Director, Services). Please review food vendor selection to obtain a competitive quote.&nbsp;</p><p>Noted that the engagement of vendor spans across three usage including OTH (Staff), actual Members&#39; Conversation as well as IVD 2016. Hence, investment for per individual may look high at $35 per person (total capped attendance is 100 pax for Actual day event- MC), consideration should also look into how this activity spans across three events.&nbsp;</p><p>&nbsp;</p><p>A post-event review will be submitted to assess event&#39;s outreach, effectiveness and key learnings.&nbsp;</p><p>&nbsp;</p>', 1, 1, 0, 48, '2016-06-23 10:49:07', 0, '2016-06-23 10:49:08', '2016-06-29 09:54:19'),
