(100, 20, 71, 1, 'Please see my email which i had sent last evening on this case.  I am not against closure of this case and I am not against writing-off some money due to SRC.  My whole point was that I told you that we are not entitled to claim salary in lieu of notice but you kept insisting that we have that right.   Well, the best recourse is to speak to one of our HR experts like Ruth or Nica to get the correct interpretation.   I have a reason why I am insisting that we must know the law  because applying the law blindly can have serious consequences (perhaps not in this particular case) but for future cases.\r\n\r\nI reiterate that I support the decision of HR to write-off the sum due to us and there is no point pursuing civil action in Court.\r\n\r\n\r\n\r\n', 5, 0, '2016-01-27 10:33:43', '2016-01-27 12:26:28'),
