(253, 74, 147, 0, '<p>Intent: This email seeks approval of H/IS and Countersigning Officer for Cash Advance amounting SGD$250 for purchase of items required for Fringe Activity.&nbsp;</p><p>H/MVD: MVD is managing the Fringe Activity portion for the Japan Exhibition, slated in March 2016. Volunteer workgroup are formed and tasked to handle various aspects including purchase of the required items. Relevant accounting and oversight on related financial documentation accompanying cash advance will be duly completed. The purchase decision under cash advance was made for the vendor (tasked to handle the exhibition) did not cater the mentioned items as part of their deliverables. As advised by spearhead department (CCM) &amp; that budget resides with IS, hence, this approval sought.</p><p>Other Reference : H/MVD (Angeline Yong) endorsed the request put forth in this AMS (CASE:&nbsp;IS/000147/2016) for Cash Advance by Project Coodinator/MVD&nbsp;(George Tai).&nbsp;</p>', 5, 0, '2016-02-05 15:10:21', '2016-02-05 15:22:53'),
(254, 44, 148, 0, '<p>I have reviewed the submission and I support the recommendation to strengthen and expand the programme with the addition funds allocated from the Care and Share Funds.</p>', 5, 0, '2016-02-05 15:43:38', '2016-02-05 15:45:24'),
