(1251, 103, 522, 0, '<p>- The cost&nbsp;of servicing the shower trolleys would only be known after the servicing has taken place, as the vendor would not have know if there are any parts that would need to be replaced before any servicing takes place.&nbsp;</p><p>- The mattress is an essential part of the shower trolley as it is the area where the resident is placed to ensure his/her comfort and safety during showers.</p>', 5, 0, '2016-04-18 16:28:32', '2016-04-18 16:28:32'),
