INSERT INTO `ams_form_mjr` (`id`, `app_id`, `date_time_damage`, `damage_description`, `operations_affected`, `created_at`, `updated_at`) VALUES
(1, 701, '2016-05-13 14:45:00', '<p><strong>Kitchen Door</strong></p><p>Kitchen door in to install metal plate on both side of doors to prevent damages cause to the door when the food trolley are being push in and out of the kitchen.&nbsp;</p><p><strong>Level 6 Medician Room</strong></p><p>The piece of wood which our nurse hold on to pull out the drawer have fall out, the nails from inside are sticking out from the wood.&nbsp;</p><p><strong>Lights In the Dormitories (Level 4 - 7)</strong></p><p>Level 5 - 6&nbsp;floursecence tube and 1 battery pack have blow out, Level 6 - 5&nbsp;floursecence tube and 1 batttery pack have blow out and Level 7 - 1 battery pack light need to be replace.&nbsp;</p>', '<p><strong>Kitchen Door</strong></p><p>The kitchen door belong to the building, if it&#39;s damge we will need to have it replace should the Home move out of this building.</p><p><strong>Level 6 Medician Room</strong></p><p>This can cause injury to the person moving in the room and not aware of the nails sticking out from the damge drawer. Please help to put the fallen out wood back soonest possible.</p><p><strong>Lights In the Dormitories (Level 4 - 7)</strong></p><p>Please replace level 7 urgently as the night duty staff is not able to the toilet as there&#39;s no light. The other 2 levels too need to be replace soonest possible due to the fire curtain is down and the dormitories are in the dark being add on with the lights not in working condition.</p><p>Please assist, thank you.</p>', '2016-05-13 14:44:22', '2016-05-13 14:44:22'),
(2, 710, '2016-05-16 09:00:00', '<p>Battery pack light in the office (level 4) is spoilt and it has a buzzing sound.&nbsp;</p>', '<p>The battery packs need to be repaired to abide by SCDF regulations and the buzzing sound is causing distraction for the staff to operate.</p>', '2016-05-16 10:18:41', '2016-05-16 10:18:41'),
(3, 864, '2016-06-07 10:15:00', '<p>Electrolux Washer Extractor - WE2 laundry machine not working as per the technican testing result show, the control unit in the motor no longer working. As such, the motor need to be place.</p>', '<p>The washing machine in the&nbsp;laundry room needs to have the motor replaced urgently. The washing machine is heavily utilised on daily basis for the cleaning of residents bedsheet and clothing.&nbsp;As&nbsp;such the staff will have to work overtiem to finish the laundry.</p><p>The cost of replacing the motor is<strong> $1950/-</strong> while replacing the whole machine cost<strong> $12,550/-</strong> . I have attached quotation below for your reference.&nbsp;Thus, it is more practical to to have the motor replaced as compared to purchasing a new machine as&nbsp;the motor cost is 10% lesser than&nbsp;the cost of a new machine. Furthermore, our present machine is&nbsp;still in good condition, no rust nor broken part.</p><p>Will appreciate if facility can help to expedite this as this is quite&nbsp;urgent.&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p>', '2016-06-07 10:47:51', '2016-06-07 10:47:51'),
(4, 866, '2016-06-07 11:00:00', '<p>Level 4 Female Staff Toilet - Water Heater&nbsp;</p>', '<p>One of the water heater in teh female staff shower room has got burning smell when used. We have instructed the staff to not the heater for the time being.&nbsp;</p><p>Can we get facilities to come and check and advise if we can get it repaired or purchase a new one.&nbsp;</p><p>Thanks!</p>', '2016-06-07 10:52:05', '2016-06-07 10:52:05'),
(5, 867, '2016-06-07 11:00:00', '<p>Level 4 Female Staff Toilet - Water Heater&nbsp;</p>', '<p>One of the water heater in teh female staff shower room has got burning smell when used. We have instructed the staff to not the heater for the time being.&nbsp;</p><p>Can we get facilities to come and check and advise if we can get it repaired or purchase a new one.&nbsp;</p><p>Thanks!</p>', '2016-06-07 10:54:09', '2016-06-07 10:54:09'),
(6, 868, '2016-06-06 11:00:00', '<p>Level 4 DAC - Battery Pack Lights</p>', '<p>2 sets of battery pack lights is down. Kindly help to expedite the repair as it obstructs the daily work of the therapists.</p><p>Thanks!</p>', '2016-06-07 10:56:26', '2016-06-07 10:56:26'),
(7, 883, '2016-06-08 11:00:00', '<p>Level 4 DAC - 1x fluorescent light is down</p>', '<p>disrupt the daily work of the therapists.</p>', '2016-06-08 10:39:20', '2016-06-08 10:39:20'),
(8, 887, '2016-06-07 15:43:00', '<p>5 ceiling fans and 7 tube lights are not working found in the female staff dormitory on level 4.</p>', '<p>Staff room has no air circulation, room is warm and humity. Further to that, almost half the room is in darkness. Staff is not able to move about in a safe dormitory.</p>', '2016-06-08 15:49:15', '2016-06-08 15:49:15'),
(9, 888, '2016-06-08 16:07:00', '<p>5 ceiling fans and 7 tube lights are not working in the female staff dormitory on level 4.</p>', '<p>Staff dormitory&nbsp;has no air circulation, room is warm and humity. Further to that, almost half the room is in darkness. Staff is not able to move about in a safe dormitory.</p>', '2016-06-08 16:09:36', '2016-06-08 16:09:36'),
(10, 921, '2016-06-13 17:00:00', '<p>Level 6 - Female Dormitory, Exit sign in resident dorm, on the left side has no light.</p>', '<p>against the SCDF requirment</p>', '2016-06-13 17:21:58', '2016-06-13 17:21:58'),
(11, 930, '2016-06-15 09:00:00', '<p>Level 4 - Office Toilet, the tap is rusty and a small part of it has chipped. We already have a replacement tap. Just need to change.</p>', '<p>User may cut their fingers while using the tap.</p>', '2016-06-15 09:39:58', '2016-06-15 09:39:58'),
(12, 932, '2016-06-15 09:00:00', '<p>Level 4 - Staff Dormitory, locks needs to be changed/tightened. Qty for locks that need&nbsp;to be replaced is 10. Will require your help to purchase the new locks. Will pass to Abdul the lock sample on thurs.</p><p>&nbsp;</p>', '<p>Staff cannot lock their lockers and keep their belongings safe.</p>', '2016-06-15 10:12:46', '2016-06-15 10:12:46'),
(13, 1002, '2016-06-29 09:00:00', '<p>Level 6 - Pantry Area, cabinet door hinge came off.</p>', '<p>The door is not able to close properly.</p>', '2016-06-29 09:40:43', '2016-06-29 09:40:43'),
(14, 1099, '2016-07-22 10:00:00', '<p>tset2</p>', '<p>test2</p>', '2016-07-20 17:14:18', '2016-07-20 09:16:15');
