(3, 373, 19, '<p>Faiszah has explained to me the situation and I have informed Eurotours to re-issue the tickets because the trip will not be useful if the dates are not changed.</p><p>Kindly raise the PR/PO after the final invoice that includes the extra charge.</p><p>&nbsp;</p><p>Nevertheless the final approver is DSG/A and not HoD/Admin for records.</p>', 118, 4, 0, '2016-03-17 17:07:58', '2016-03-17 17:07:58'),
(4, 615, 21, '<p>I have no objections as it would save the Society a considerable sum. &nbsp;I am forwarding to Finance as well.&nbsp;</p><p>&nbsp;</p><p>Please note that in future, for submissions involving money and related matters (e.g. mode of payment), route it through Head/Finance.&nbsp;</p>', 147, 4, 0, '2016-05-04 07:01:34', '2016-05-04 07:01:34'),
(5, 685, 147, '<p>Dear DSG/A,&nbsp;</p><p>I forward this request to you due to the approval matrix requirements. For your necessary action and review, please.</p><p>&nbsp;</p>', 118, 4, 0, '2016-05-16 17:25:32', '2016-05-16 17:25:32'),
(6, 810, 57, '<p>Hi All,</p><p>This amount is too big. Although the course may be helpful to them, please also provide evidence in writing of how exactly going for this course will provide for increased healthcare service for the residents, and provide for solid evidence of why they should be sent for this course. It&#39;s not enough to say they are dedicated, must explain how, and also explain how they have strong purpose to excel, and indicate too what is their future potential.</p><p>Also I suggest that they need to be bonded to SRC after they completed the course.</p><p>I have forwarded this to Serene, plus please also obtain approval from Sec Gen.&nbsp;</p>', 65, 4, 0, '2016-06-01 10:54:37', '2016-06-01 10:54:37'),
(7, 993, 121, '<p>Approved to produce marketing materials for Missing Type campaign at&nbsp;$1995.77 with Botak Sign Pte Ltd (approved vendor apparently).</p><p>Forwarding to CPU as well for verification as per approval matrix.</p>', 19, 4, 0, '2016-06-28 10:45:03', '2016-06-28 10:45:03'),
(9, 1043, 203, '<p>tets231</p>', 204, 4, 0, '2016-07-26 17:14:33', '2016-07-26 09:14:33'),
(10, 1043, 204, '<p>ssdff</p>', 203, 4, 0, '2016-07-26 17:31:03', '2016-07-26 09:31:03'),
(11, 1208, 201, '<p>test</p>', 205, 4, 0, '2016-11-29 17:36:04', '2016-11-29 09:36:04');
